import styled from 'styled-components';

const Layout = styled.div`
  width: 100vw;
  height: 100vh;
  background: lightgray;
`;

const Home = () => {
  return (
    <>
      <h1>Header</h1>
      <h1>Welcome home</h1>
      <h1>Footer</h1>
    </>
  );
};

export default Home;
